import React, { useState } from 'react';
import Modal from 'react-modal';

Modal.setAppElement('#root');

const CompletionModal = ({ task, onClose, onUpdate }) => {
  const [explanation, setExplanation] = useState('');
  const [workLink, setWorkLink] = useState('');
  const [status, setStatus] = useState('done');
  const [loading, setLoading] = useState(false);

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);

    try {
      const response = await fetch(`http://localhost:5000/api/work/${task._id}/complete`, {
        method: 'PUT',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': `Bearer ${localStorage.getItem('token')}`
        },
        body: JSON.stringify({
          status,
          explanation: explanation || undefined,
          workLink: workLink || undefined
        })
      });

      if (response.ok) {
        onUpdate();
        onClose();
        alert('Task completed successfully!');
      } else {
        const error = await response.json();
        alert('Error completing task: ' + error.message);
      }
    } catch (error) {
      console.error('Error completing task:', error);
      alert('Error completing task: ' + error.message);
    } finally {
      setLoading(false);
    }
  };

  const modalStyles = {
    content: {
      top: '50%',
      left: '50%',
      right: 'auto',
      bottom: 'auto',
      marginRight: '-50%',
      transform: 'translate(-50%, -50%)',
      width: '500px',
      maxWidth: '90%'
    }
  };

  return (
    <Modal isOpen={true} onRequestClose={onClose} style={modalStyles}>
      <div>
        <h3>Complete Task</h3>
        <div className="mb-3">
          <strong>Task:</strong> {task.task}
        </div>
        {task.instructions && (
          <div className="mb-3">
            <strong>Instructions:</strong> {task.instructions}
          </div>
        )}
        
        <form onSubmit={handleSubmit}>
          <div className="mb-3">
            <label className="form-label">Status:</label>
            <select 
              className="form-control" 
              value={status} 
              onChange={e => setStatus(e.target.value)}
              disabled={loading}
            >
              <option value="done">Done as requested</option>
              <option value="custom">Done differently (explain below)</option>
            </select>
          </div>
          
          {status === 'custom' && (
            <div className="mb-3">
              <label className="form-label">Explanation (required for different approach):</label>
              <textarea 
                className="form-control" 
                value={explanation} 
                onChange={e => setExplanation(e.target.value)}
                placeholder="Explain how you completed the task differently..."
                required
                disabled={loading}
              />
            </div>
          )}
          
          <div className="mb-3">
            <label className="form-label">Link to work (optional):</label>
            <input 
              type="url" 
              className="form-control" 
              value={workLink} 
              onChange={e => setWorkLink(e.target.value)}
              placeholder="https://..."
              disabled={loading}
            />
          </div>
          
          <div className="mb-3">
            <label className="form-label">Additional explanation (optional):</label>
            <textarea 
              className="form-control" 
              value={explanation} 
              onChange={e => setExplanation(e.target.value)}
              placeholder="Any additional notes about completion..."
              disabled={loading}
            />
          </div>
          
          <div className="d-flex gap-2">
            <button 
              type="submit" 
              className="btn btn-primary"
              disabled={loading}
            >
              {loading ? 'Completing...' : 'Complete Task'}
            </button>
            <button 
              type="button" 
              className="btn btn-secondary" 
              onClick={onClose}
              disabled={loading}
            >
              Cancel
            </button>
          </div>
        </form>
      </div>
    </Modal>
  );
};

export default CompletionModal;
